import "./Projects.css";
import gymicon from "/images/gym-icon.png"

const Projects = () => {
    return (
        <div className="projects">
            <h1>My Projects</h1>
            <div className="projects-wrapper">
                <fast-card class="first-card">
                    <h2>My next gym</h2>
                </fast-card>
            </div>
        </div>
    );
};

export default Projects;
